import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import logo from '../../assets/images/logo-principal.png';
import icono from '../../assets/images/icono-perfil.jpg';
import './Proyectos.css';

const Proyectos: React.FC = () => {
    const navigate = useNavigate();
    const [userName, setUserName] = useState('');
    const [userRole, setUserRole] = useState('');

    const roles: { [key: number]: string } = {
        1: 'ScrumMaster',
    };

    useEffect(() => {
        const token = localStorage.getItem('authToken');
        if (!token) {
            navigate('/login');
        } else {
            const fetchUserProfile = async () => {
                try {
                    const response = await fetch('http://localhost:8081/api/auth/perfil', {
                        method: 'GET',
                        headers: {
                            'Authorization': `Bearer ${token}`,
                        },
                    });

                    if (response.ok) {
                        const data = await response.json();
                        setUserName(data.perfil.nombre);
                        setUserRole(roles[data.perfil.id_rol as number] || 'Rol desconocido');
                    } else {
                        console.error('Error al obtener perfil:', await response.text());
                        navigate('/login');
                    }
                } catch (error) {
                    console.error('Error al obtener perfil:', error);
                    navigate('/login');
                }
            };

            fetchUserProfile();
        }
    }, [navigate]);

    const handleLogout = () => {
        localStorage.removeItem('authToken');
        navigate('/login');
    };

    const handleNewProject = () => {
        navigate('/Newproyect');
    };

    const handleChat = () => {
        navigate('/Chatproyect');
    };

    const handleProyectClick = () => {
        navigate('/Sprints');
    };

    return (
        <div className="container m-4">
            {/* HEADER */}
            <div className="d-flex flex-wrap justify-content-between align-items-center mt-3 px-4">
                <img src={logo} alt="Logo" className="logo mb-3 mb-md-0" />
                <div className="d-flex">
                    <a href="#" onClick={handleChat} className="text-light fs-1 mx-2">
                        <i className="bi bi-chat-right"></i>
                    </a>
                    <a href="#" className="text-light fs-1 mx-2">
                        <i className="bi bi-bell"></i>
                    </a>
                    <a href="#" className="text-light fs-1 mx-2">
                        <i className="bi bi-person-circle"></i>
                    </a>
                    <a href="#" onClick={handleLogout} className="text-light fs-1 mx-2">
                        <i className="bi bi-box-arrow-right"></i>
                    </a>
                </div>
            </div>

            {/* CONTENIDO */}
            <div className="row mt-4">
                <div className="col-12 col-md-3 text-center mb-4">
                    <img src={icono} alt="Icono" className="img-perfil" />
                    <div className="cont mt-4 border">
                        <p className="text-light text-center m-2">Nombre: {userName}</p>
                        <p className="text-light text-center m-2">Puesto: {userRole}</p>
                    </div>
                </div>

                <div className="col-12 col-md-9">
                    <div className="row mb-3">
                        <div className="col-8">
                            <input
                                type="text"
                                className="form-control"
                                placeholder="Escribe algo aquí..."
                            />
                        </div>
                        <div className="col-4">
                            <button
                                type="button"
                                className="btn btn-outline-light w-100"
                                onClick={handleNewProject}
                            >
                                Nuevo Proyecto
                            </button>
                        </div>
                    </div>
                    <div className="row border py-3" onClick={handleProyectClick}>
                        <div className="col-9">
                            <p className="text-light">Proyecto</p>
                            <p className="text-light">Fecha de Inicio</p>
                            <p className="text-light">Estatus</p>
                        </div>
                        <div className="col-3 text-center">
                            <i className="bi bi-justify text-light fs-1"></i>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Proyectos;
